script: |
  super -f text -I q6808.spq | sort > q6808.out

inputs:
  - name: q6808.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + 81 * + + col2 + - - ( + - col2 ) IN ( + 54 * + 65 * + + col2, CAST ( 74 AS INTEGER ), + col2 );
  - name: tab2

outputs:
  - name: q6808.out
    data: |
      46	51	23
      64	77	40
      75	67	58
